inline float fastsqrt(float x)
{
	unsigned int i = *(unsigned int*)&x;

	i += 127 << 23;
	// approximation of square root
	i >>= 1;
	return *(float*)&i;
}

#define square( x ) ( x * x )

void MinWalk(CUserCmd* get_cmd, float get_speed)
{
	if (get_speed <= 0.f)
		return;

	float min_speed = (float)(fastsqrt(square(get_cmd->forwardmove) + square(get_cmd->sidemove) + square(get_cmd->upmove)));
	if (min_speed <= 0.f)
		return;

	if (get_cmd->buttons & IN_DUCK)
		get_speed *= 2.94117647f;

	if (min_speed <= get_speed)
		return;

	float kys = get_speed / min_speed;

	get_cmd->forwardmove *= kys;
	get_cmd->sidemove *= kys;
	get_cmd->upmove *= kys;
}

void CMAntiAim::Slowwalk(CUserCmd* cmd) //slowwalk code
{
	if (vars.antiaim.slowwalk->active || csgo->should_stop_slide)
	{
		auto weapon_auto = csgo->local->GetWeapon()->GetItemDefinitionIndex() == WEAPON_G3SG1 && WEAPON_SCAR20;
		auto weapon_awp = csgo->local->GetWeapon()->GetItemDefinitionIndex() == WEAPON_AWP;
		auto weapon_ssg = csgo->local->GetWeapon()->GetItemDefinitionIndex() == WEAPON_SSG08;

		if (weapon_auto) {
			if (csgo->local->GetFlags() & FL_ONGROUND) {
				MinWalk(cmd, 40); //auto slowwalk 
			}
		}
		if (weapon_awp) {
			if (csgo->local->GetFlags() & FL_ONGROUND) {
				MinWalk(cmd, 33); //awp slowalk
			}
		}
		if (weapon_ssg) {
			if (csgo->local->GetFlags() & FL_ONGROUND) {
				MinWalk(cmd, 70); //ssg slowwalk
			}
		}
		if (!weapon_awp && !weapon_auto && !weapon_ssg) { //for every weapon btw
			if (csgo->local->GetFlags() & FL_ONGROUND) {
				MinWalk(cmd, 34);
			}
		}
	}
}

void CMAntiAim::Run(bool& send_packet, CUserCmd* cmd)
{
	Slowwalk(cmd);

	shouldAA = true;
	if (!vars.antiaim.enable)
	{
		shouldAA = false;
		return;
	}
	if (csgo->cmd->buttons & IN_USE)
	{
		shouldAA = false;
		return;
	}
	if (csgo->game_rules->IsFreezeTime()
		|| csgo->local->GetMoveType() == MOVETYPE_NOCLIP
		|| csgo->local->GetMoveType() == MOVETYPE_LADDER)
	{
		shouldAA = false;
		return;
	}
	bool DoAA = false;
	for (int i = 1; i < 65; i++)
	{
		auto ent = interfaces.ent_list->GetClientEntity(i);
		if (!ent)
			continue;
		if (
			!ent->isAlive()
			|| ent == csgo->local
			|| ent->GetTeam() == csgo->local->GetTeam()
			)
			continue;
		DoAA = true;
		break;

	}
	if (!DoAA)
	{
		if (csgo->ForceOffAA)
		{
			shouldAA = false;
			return;
		}
	}
	if (csgo->weapon->GetItemDefinitionIndex() == WEAPON_REVOLVER)
	{
		if (Ragebot::Get().shot /*&& Ragebot::Get().IsAbleToShoot()*/)
		{
			shouldAA = false;
			return;
		}
	}
	else
	{
		if (F::Shooting() || csgo->TickShifted || (CanDT() && csgo->cmd->buttons & IN_ATTACK /*&& Ragebot::Get().IsAbleToShoot()*/))
		{
			shouldAA = false;
			return;
		}
		if (csgo->weapon->IsKnife()) {
			if ((csgo->cmd->buttons & IN_ATTACK || csgo->cmd->buttons & IN_ATTACK2) && Ragebot::Get().IsAbleToShoot())
			{
				shouldAA = false;
				return;
			}
		}
	}

	if (shouldAA)
	{
		Pitch(send_packet);
		Jitter();
		Spin();
		//Test();
		Yaw(send_packet);
	}
};

